            $conn = ftp_connect($domain, $port);
        }
        if (!$ssl) {
            ftp_login($conn, $username, $password);
        }
        $ftp_folder = trim(post_param_string('ftp_folder'));
        if (substr($ftp_folder, -1) != '/') {
            $ftp_folder .= '/';
