 */
function step_5_uninstall()
{
    $log = new Tempcode();
    require_code('database_action');
    require_code('config');

    if (post_param_string('forum_type') != 'none') {
        $tmp = new DatabaseConnector(get_db_forums(), get_db_forums_host(), get_db_forums_user(), get_db_forums_password(), '');
